import React,{Component} from 'react';
import '../pages/HomePage/homePage.less';

class Header extends Component{
  constructor(props){
    super(props);
    this.state={};
  }
  
  render(){
    return(
      <React.Fragment>
        <div className="header">
          <div className="header-container">
              <ul>
                <li>中国大陆</li>
                <li>请登录</li>
                <li>手机逛淘宝</li>
              </ul>
          </div>
        </div>
      </React.Fragment>
    )
  }
}

export default Header;
